function changeStyleDisplay(name,style){
    document.getElementById(name).style.display = style;
}

function changeInputValue(name,value){
    document.getElementById(name).value = value;
}



function createAlertMessage(iconType,title,text){
    Swal.fire({
        icon: iconType,
        title: title,
        text: text
    });
    return;
}

